import React from "react";
import "../HojasDeEstilo/Educacion.css"

function Educacion (){
  return(
    <section className="container text-center text-white educacion-me">
    <div>
      <h1 id="Educacion-me">Education</h1>
      <h3 className="educacion-me-h3">
         * Estudiantes de la "Universidad Autonoma Tomas Frias" </h3>
         <h3 className="educacion-me-h3">
         * Tecnico medio en software "INSTITUTO INBOLJAP"</h3>
    </div>
  </section>
  )
}
export default Educacion
